css:
@-moz-document domain("roblox.com")
{

  @keyframes x
  {
    0% {left: -128px;
  }

  50%
  {
    left: calc(50% - 64px);
  }

  100%
  {
    left: 100%;
  }
}

@keyframes y
{
  0%
  {
    top: -128px;
  }

  50%
  {
    top: calc(50% - 64px);
  }

  100%
  {
    top: 100%;
  }
}

@keyframes z
{
  0%
  {
    transform: scale(1);
  }

  50%
  {
    transform: scale(.6);
  }

  100%
  {
    transform: scale(.2);
  }
}

:nth-child(odd)
{
  z-index: 1;
}

html
{
  overflow-x: hidden;
}

html:after
{
  content: "";
  position: fixed;
  width: 128px;
  height: 128px;
  animation: 15s ease-in-out infinite alternate;
  animation-name: x, y, z;
  animation-duration: 13s, 23s, 5s;
  animation-delay: -1000s;
   background: url('data:image/gif;base64,');
  
}
}
